const CollectionPreview = ({title,items}) => {
    return(
        <div>
            <h1>{title}</h1>
            <div>
                {items.filter((item,index) => index <4 ).map((item) => <div>{item.name}</div>)}
            </div>
        </div>
    )
}


export default CollectionPreview;
